func convertAvg(data [4]byte) float32 {
	var tempConv []byte = data[:]
	strTempConv := hex.EncodeToString(tempConv)
	n, err := strconv.ParseUint(strTempConv, 16, 32)
	if err != nil {
		panic(err)
	}
	n2 := uint32(n)
	f := *(*float32)(unsafe.Pointer(&n2))
	return f
}

func convert2(data [4]byte) time.Time {
	var datetimeConv []byte = data[:]
	strDatetimeConv := hex.EncodeToString(datetimeConv)
	valueTime, err := strconv.ParseInt(strDatetimeConv, 16, 64)
	if err != nil {
		fmt.Printf("Conversion failed: %s\n", err)
	}
	tm := time.Unix(valueTime, 0)
	return tm
}

